import React, {Component} from 'react';
import axios from 'axios';
import {Button} from 'react-bootstrap';

axios.defaults.withCredentials = true;
const headers = {withCredentials: true};

class MyPostItems extends Component {
    render(){
        const myPosts = this.props.entries.map((post)=>{
            return  <tr key={post.id} createdAt={post.createdAt}>
                    <td>{post.createdAt}</td><td>{post.content}</td><td>{post.member.nickname}</td>
                    <td><Button variant="warning" size="sm" onClick={this.props.superDelete.bind(null, post.id)}>삭제</Button></td>
                    <td><Button variant="info" size="sm" onClick={this.props.superUpdate.bind(null, post.id)}>수정</Button></td>
                                    
                    </tr>
        });
        return(
            <div>
                <table>
                    <thead>
                        <tr>
                        <th>작성일자</th><th>내용</th><th>작성자</th>
                        </tr>
                    </thead>
                    <tbody>
                        {myPosts}
                    </tbody>
                </table>
            </div>
        );
    }
}

export default MyPostItems;
